step.command:
use ElectricCommander ();
use strict;
$|=1;

my $ec = new ElectricCommander;
my $sourceProp = "/myProcedure/changeLog1";
my $val=$ec->getProperty("$sourceProp")->findvalue('//value')->string_value;

$ec->setProperty("/myJob/ecscm_changeLogs", $val);

use ElectricCommander ();
use strict;
$|=1;

my $ec = new ElectricCommander;
$ec->setProperty("/myJob/ecscm_changeLogs", "aaa-111");

